use std::collections::HashSet;

fn main() {
    let mut set = HashSet::<u8>::new();
    const MARKER_LEN: usize = 14;
    let input = "".as_bytes();
    for i in MARKER_LEN..=input.len() {
        let range = &input[i - MARKER_LEN..i];

        set.clear();
        set.extend(range.iter().cloned());

        let unique = set.len() == MARKER_LEN;
        if unique {
            println!("{}", i);
            return;
        }
    }
}
